import React, { Component } from 'react';
import {Button, Navbar, NavItem, Row, Icon} from 'react-materialize'
import './LandingPage.css'


class LandingPage extends Component {
    render(){
        return(
            <div>
                <Navbar className="deep-purple brand-logo" brand='TimeOff App' right>
                    <NavItem className="deep-purple accent-1" onClick={() => console.log('test click')}><span className="navitem-font navitem-color">PRICING</span></NavItem>
                    <NavItem className="deep-purple accent-1 " href='components.html' > <span className="navitem-font navitem-color">LOG IN</span></NavItem>
                    <NavItem className="deep-purple accent-1 " href='components.html'> <span className=" navitem-font navitem-color navitem-btn">REGISTER</span></NavItem>
                </Navbar>
            </div>

        )
    }
};

export default LandingPage;
